import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
    return (
      <div className="App">
    <ul>FrontEndDev
     <li>CSS</li>
     <li>HTML</li>
     <li>JavaScript</li>
     <li>React</li>
    </ul>
      </div>
    );
}

export default App;
